import React from 'react';
import classNames from 'classnames';
import {InputText} from 'primereact/inputtext';
import {Dropdown} from 'primereact/dropdown';
import {Password} from 'primereact/password';
import {ColorPicker} from 'primereact/colorpicker';
import {InputSwitch} from 'primereact/inputswitch';
import {InputNumber} from 'primereact/inputnumber'




const Formulario=({StateData,setStateData,OpenForm}) => {

  return (
    <React.Fragment>
      <div className="p-field">
        <label >Clave</label>
        <InputText
          value={StateData.clave}
          onChange={(e) => setStateData({...StateData,clave: e.target.value})}
          required
          autoFocus
          className={classNames({'p-invalid': OpenForm&&!StateData.clave})} />
        {OpenForm&&!StateData.clave&&<small className="p-invalid">clave es requerido.</small>}
      </div>
      <div className="p-field p-col">
        <label htmlFor="clave">Nombre</label>
        <InputText
          value={StateData.nombre}
          onChange={(e) => setStateData({...StateData,nombre: e.target.value})}
          required
          autoFocus
          className={classNames({'p-invalid': OpenForm&&!StateData.nombre})} />
        {OpenForm&&!StateData.nombre&&<small className="p-invalid">Campo es requerido.</small>}
      </div>
      {/* Campo de Descripcion */}
      <div className="p-field p-col">
        <label htmlFor="descripcion">Descripcion</label>
        <InputText
          value={StateData.descripcion}
          onChange={(e) => setStateData({...StateData,descripcion: e.target.value})}
          required
          autoFocus
          className={classNames({'p-invalid': OpenForm&&!StateData.descripcion})} />
        {OpenForm&&!StateData.descripcion&&<small className="p-invalid">Apellido Paterno es required.</small>}
      </div>
      {/* Stock */}
      <div className="p-field p-col">
        <label htmlFor="descripcion">stock</label>
        <InputNumber
          value={StateData.stock}
          onChange={(e) => setStateData({...StateData,stock: e.value})}
          autoFocus
          className={classNames({'p-invalid': OpenForm&&!StateData.stock})} />
        {OpenForm&&!StateData.stock&&<small className="p-invalid">Costo is required.</small>}
      </div>
      {/* Campo de Costo de Compra */}
      <div className="p-field p-col">
        <label htmlFor="costoCompra">Costo de Compra</label>
        <InputNumber
          value={StateData.costoCompra}
          onChange={(e) => setStateData({...StateData,costoCompra: e.value})}
          required
          autoFocus
          className={classNames({'p-invalid': OpenForm&&!StateData.costoCompra})} />
        {OpenForm&&!StateData.costoCompra&&<small className="p-invalid">Costo is required.</small>}
      </div>
      {/* Costo a Publico */}
      <div className="p-field p-col">
        <label htmlFor="costoPublico">Costo a Publico</label>
        <InputNumber id="withoutgrouping"
          value={StateData.costoPublico}
          onChange={(e) => setStateData({...StateData,costoPublico: e.value})}
          mode="decimal" useGrouping={false}
          className={classNames({'p-invalid': OpenForm&&!StateData.costoPublico})} />
        {OpenForm&&!StateData.costoPublico&&<small className="p-invalid">Costo is required.</small>}
      </div>
    </React.Fragment>


  )
}

export default Formulario;
